-- Lab 1 of the SQL Simplified Labs! 

-- 1) Show only the top 5 rows from the members table ?

select * from members
limit 5;

-- 2) Sort all the rows in the members table by first_name in alphabetical order and show the top 3 rows with all columns?

select * from members
order by first_name
limit 3;

-- 3) Count the number of records from the members table which have United States as the region value?

select count(*) as US_members
from members
where region = 'United States';

--  4) Select only the first_name and region columns for mentors who are not from Australia?--


select first_name,region
from members
where region != 'Australia';

--  5) Return only the unique region values from the members table and sort the output by reverse alphabetical order? --

select distinct region 
from members
order by region desc;

--Lab 2 of the SQL Simplified Labs!

--  1) How many records are there per ticker value in the prices table?

select ticker, 
count(*) as record_count
from prices
group by ticker;

-- 2:- What is the maximum, minimum values for the price column for both Bitcoin and Ethereum in 2020?

SELECT 
    ticker,
    MAX(price) AS max_price,
    MIN(price) AS min_price
FROM prices
WHERE ticker IN ('BTC', 'ETH')
  AND YEAR(market_date) = 2020
GROUP BY ticker;

-- 3) What is the annual minimum, maximum and average price for each ticker?


SELECT 
    ticker,
    YEAR(market_date) AS year,
    MIN(price) AS min_price,
    MAX(price) AS max_price,
    AVG(price) AS avg_price
FROM prices
GROUP BY ticker, YEAR(market_date)
ORDER BY ticker, year;

-- 4)  What is the monthly average of the price column for each ticker from January 2020 and after?--

select ticker,
year(market_date) as year,
month(market_date) as month,
avg(price)
from prices
where market_date >= '2020-01-01'
group by ticker,year(market_date),month(market_date)
order by ticker,year,month;



-- Lab 3 of the SQL Simplified Labs!

--  1) Convert the volume column in the prices table with an adjusted integer value to take into the unit values
--  Return only the market_date, price, volume and adjusted_volume columns for the first 10 days of August 2021 for Ethereum only--
  SELECT
  market_date,
  price,
  volume,
  CASE
    WHEN RIGHT(volume, 1) = 'K' THEN LEFT(volume, LENGTH(volume)-1)::NUMERIC * 1000
    WHEN RIGHT(volume, 1) = 'M' THEN LEFT(volume, LENGTH(volume)-1)::NUMERIC * 1000000
    WHEN volume = '-' THEN 0
  END AS adjusted_volume
FROM prices
WHERE ticker = 'ETH'
  AND market_date BETWEEN '2021-08-01' AND '2021-08-10'
ORDER BY market_date;


-- 2) How many "breakout" days were there in 2020 where the price column is greater than the open column for each ticker? 
-- In the same query also calculate the number of "non breakout" days where the price column was lower than or equal to the open column.


SELECT 
    ticker,
    SUM(price > open) AS breakout_days,
    SUM(price <= open) AS non_breakout_days
FROM prices
WHERE YEAR(market_date) = 2020
GROUP BY ticker;

