-- 1) What are the market_date, price and volume and price_rank values for the days with the top 5 highest price values for each tickers in the prices table?
--      a)The price_rank column is the ranking for price values for each ticker with rank = 1 for the highest value.
--      b)Return the output for Bitcoin, followed by Ethereum in price rank order.

WITH cte_rank AS (
SELECT
  ticker,
  market_date,
  price,
  volume,
  RANK() OVER (
    PARTITION BY ticker
    ORDER BY price DESC
  ) AS price_rank
FROM prices
)
SELECT * FROM cte_rank
WHERE price_rank <= 5
ORDER BY ticker, price_rank;

-- 2) 2:- Calculate a 7 day rolling average for the price and volume columns in the prices table for each ticker, return only the 10 days of august 2021.

SELECT
    ticker,
    market_date,
    price,
    volume,
    AVG(price) OVER (
        PARTITION BY ticker
        ORDER BY market_date
        ROWS BETWEEN 6 PRECEDING AND CURRENT ROW
    ) AS moving_avg_price,
    AVG(volume) OVER (
        PARTITION BY ticker
        ORDER BY market_date
        ROWS BETWEEN 6 PRECEDING AND CURRENT ROW
    ) AS moving_avg_volume
FROM prices
WHERE market_date BETWEEN '2021-08-01' AND '2021-08-10'
ORDER BY ticker, market_date;


-- 3) Calculate the monthly cumulative volume traded for each ticker in 2020, sort the output by ticker in chronological order with the month_start as the first day of each month?

WITH cte_monthly_volume AS (
    SELECT
        ticker,
        DATE_FORMAT(market_date, '%Y-%m-01') AS month_start,
        SUM(
            CASE
                WHEN RIGHT(volume, 1) = 'K' THEN CAST(LEFT(volume, LENGTH(volume)-1) AS DECIMAL) * 1000
                WHEN RIGHT(volume, 1) = 'M' THEN CAST(LEFT(volume, LENGTH(volume)-1) AS DECIMAL) * 1000000
                WHEN volume = '-' THEN 0
                ELSE CAST(volume AS DECIMAL)
            END
        ) AS monthly_volume
    FROM prices
    WHERE market_date BETWEEN '2020-01-01' AND '2020-12-31'
    GROUP BY ticker, month_start
    )
SELECT
    ticker,
    month_start,
    SUM(monthly_volume) OVER (
        PARTITION BY ticker
        ORDER BY month_start
        ROWS BETWEEN UNBOUNDED PRECEDING AND CURRENT ROW
    ) AS cumulative_monthly_volume
FROM cte_monthly_volume
ORDER BY ticker, month_start;


-- 4) Calculate the daily percentage change in volume for each ticker in the prices table?
-- a)Percentage change can be calculated as (current - previous) / previous
-- b)Multiply the percentage by 100 and round the value to 2 decimal places
-- c)Return data for the first 10 days of August 2021

SELECT
    ticker,
    market_date,
    volume,
    ROUND(
        ((volume - LAG(volume) OVER (PARTITION BY ticker ORDER BY market_date))
         / LAG(volume) OVER (PARTITION BY ticker ORDER BY market_date)) * 100, 2
    ) AS daily_pct_change
FROM prices
WHERE market_date BETWEEN '2021-08-01' AND '2021-08-10';

-- Lab 5 of the SQL Simplified Labs!
-- 1) - Which top 3 mentors have the most Bitcoin quantity? Return the first_name of the mentors and sort the output from highest to lowest total_quantity?

SELECT
  members.first_name,
  SUM(
    CASE
      WHEN transactions.txn_type = 'BUY'  THEN transactions.quantity
      WHEN transactions.txn_type = 'SELL' THEN -transactions.quantity
    END
  ) AS total_quantity
FROM transactions
INNER JOIN members
  ON transactions.member_id = members.member_id
WHERE transactions.ticker = 'BTC'
GROUP BY members.first_name
ORDER BY total_quantity DESC
LIMIT 3;


-- 2)Show the market_date values which have less than 5 transactions? Sort the output in reverse chronological order.

SELECT
  prices.market_date,
  COUNT(transactions.txn_id) AS transaction_count
FROM prices
LEFT JOIN transactions
  ON prices.market_date = transactions.txn_date
  AND prices.ticker = transactions.ticker
GROUP BY prices.market_date
HAVING COUNT(transactions.txn_id) < 5
ORDER BY prices.market_date DESC;


-- 3)Multiple Table Joins
--For this question - we will generate a single table output which solves a multi-part problem about the dollar cost average of BTC purchases.

--Part 1: Calculate the Dollar Cost Average
		--a) What is the dollar cost average (btc_dca) for all Bitcoin purchases by region for each calendar year?
--Create a column called year_start and use the start of the calendar year
--The dollar cost average calculation is btc_dca = SUM(quantity x price) / SUM(quantity)

--Part 2: Yearly Dollar Cost Average Ranking
		--b) Use this btc_dca value to generate a dca_ranking column for each year
--The region with the lowest btc_dca each year has a rank of 1

--Part 3: Dollar Cost Average Yearly Percentage Change
		--c) Calculate the yearly percentage change in DCA for each region to 2 decimal places
--This calculation is (current - previous) / previous
--Finally order the output by region and year_start columns.

WITH cte_dollar_cost_average AS (
    SELECT
        DATE_FORMAT(t.txn_date, '%Y-01-01') AS year_start,
        m.region,
        SUM(t.quantity * p.price) / NULLIF(SUM(t.quantity), 0) AS btc_dca
    FROM transactions t
    INNER JOIN prices p
        ON t.ticker = p.ticker
        AND t.txn_date = p.market_date
    INNER JOIN members m
        ON t.member_id = m.member_id
    WHERE t.ticker = 'BTC'
        AND t.txn_type = 'BUY'
    GROUP BY year_start, m.region
),
cte_window_functions AS (
    SELECT
        year_start,
        region,
        btc_dca,
        RANK() OVER (
            PARTITION BY year_start
            ORDER BY btc_dca
        ) AS dca_ranking,
        LAG(btc_dca) OVER (
            PARTITION BY region
            ORDER BY year_start
        ) AS previous_btc_dca
    FROM cte_dollar_cost_average
)
SELECT
    year_start,
    region,
    btc_dca,
    dca_ranking,
    ROUND(
        (btc_dca - previous_btc_dca) / NULLIF(previous_btc_dca, 0) * 100,
        2
    ) AS dca_percentage_change
FROM cte_window_functions
ORDER BY region, year_start;

















